import React, {Component} from 'react';
import PropTypes from 'prop-types';
import {Route} from "react-router-dom";
import About from "./About";
import Rooms from "./Rooms";
import Contacts from "./Contacts";
import SignUp from "./SignUp";
import ApplicationForm from "./ApplicationForm";
import LogIn from "./LogIn";

class ClientMainContent extends Component {



    render() {
        return (
            <React.Fragment>
                <Route
                    path="/"
                    exact
                    component={About}
                />
                <Route
                    path="/rooms"
                    component={Rooms}
                />
                <Route
                    path="/contacts"
                    component={Contacts}
                />
                <Route
                    path="/signup"
                    component={SignUp}
                />
                {this.state.applicationFormVisible
                    ? <ApplicationForm
                        closeAppWindow={this.closeApplicationForm}
                        userName={this.state.userName}
                        token={this.state.token}
                    />
                    : null
                }
                {this.state.logInFormVisible
                    ? <LogIn closeLogInForm={this.closeLogInForm} storeResponse={this.storeResponse}/>
                    : null
                }
            </React.Fragment>
        );
    }
}

ClientMainContent.propTypes = {};

export default ClientMainContent;
